void draw_bosco(MatrixPanel_I2S_DMA* display, int offsetX, int offsetY) {
  for (int y = 0; y < bosco_height; y++) {
    for (int x = 0; x < bosco_width; x++) {
      uint8_t r = pgm_read_byte(&bosco_red[y][x]);
      uint8_t g = pgm_read_byte(&bosco_green[y][x]);
      uint8_t b = pgm_read_byte(&bosco_blue[y][x]);
      display->drawPixelRGB888(x + offsetX, y + offsetY, r, g, b);
    }
  }
}

